import "./App.css";
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Routes,
  Route,
  Link,
} from "react-router-dom";
import Contact from "./pages/Contact";

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <ul>
            <li>
              <Link to="/">Home</Link>
              <li>
                {/* Haremos la ruta y cuando carguemos se iniciara routes*/}
                <Link to="/contact">Contacto</Link>
              </li>
            </li>
          </ul>
        </div>
        <Routes>
          <Route path="/contact" element={<Contact />}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
